import React, { Fragment, useEffect, useState } from "react";
import { getProduct, deleteProduct } from "../../services/products";
import { Button, Card, CardContent, Typography, Box, Divider } from "@mui/material";
import {ToastContainer, toast } from "react-toastify";
import {red } from "@mui/material/colors"

import ModalWrapper from "../../components/ModalWrapper";
import DeleteModal from "../../components/deleteModal";

const Product = () => {
  const [products, setProducts] = useState([]);
  const [isOpen, setIsOpen] = useState(false);
  const [selectedRow, setSelectedRow] = useState();
  const [deleteModal, setDeleteModal] = useState(false);
  const [deleteId, setDeleteId] = useState();

  useEffect(() => {
    fetchData();
    return () => null;
    // eslint-disable-next-line
  }, []);

  let product_id;
  let price;
  let category;
  let availability_status;

  const fetchData = async () => {
    const data = await getProduct({
      product_id,
      price,
      category,
      availability_status,
    });

    setProducts(data?.message?.items_list);
  };

  const handleToggle = () => {
    setIsOpen(!isOpen);
  };

  const addProduct = () => {
    setSelectedRow(null);
    handleToggle();
  };

  const handleClick = async (item) => {
    const response = await getProduct({ product_id: item.product_id });

    setSelectedRow(response?.message?.items_list[0]);
    handleToggle();
  };

  const updateProduct = (editProduct) => {
    const _products = [...products];
    const _newProducts = _products.filter(
      (item) => item.product_id !== editProduct.product_id
    );
    _newProducts.unshift({ ...editProduct });
    setProducts(_newProducts);
  };

  const handleDeleteProduct = async () => {
    console.log("index", deleteId);

    const response = await deleteProduct(deleteId);

    if (response && response.status) {
      const data = [...products];
      const _data = data.filter((item) => item.product_id !== deleteId);
      setProducts(_data);
      toast.success("Successfully Deleted");
    }
  };

  return (
    <Box flex={1} p={4}>
      {/* <Card> */}
      {/* <CardContent> */}
      <Box display="flex" justifyContent="space-between" alignItems={"center"} mb={4}>
<h3>Task development</h3>
      <Button
        variant="contained"
        color="primary"
        onClick={addProduct}
        className="mb-3 mt-3 align-self-center"
      >
        Add Product
      </Button>


      </Box>
<Divider m />
      {products?.length === 0 ? (
        <div>no result</div>
      ) : (
        products.map((item) => (
          <Card
            key={item.product_id}
            style={{
              width: "100%",
              flexGrow: 1,
              marginBottom: 30
            }}
          >
            <CardContent>
              <Typography variant="h5" component="div" mb={3}>
                 {item.name}
              </Typography>
              <Box flex={1} mb={3}>
              <Typography mb={1} variant="body2">Category: {item.category}</Typography>
              <Typography mb={1} variant="body2">Description: {item.description}</Typography>
              <Typography mb={1} variant="body2">Price: {item.price}</Typography>
              <Typography mb={1} variant="body2">
                Availability: {item.availability_status}
              </Typography>

              </Box>
              <Box display="flex" flex={1} width="100%" justifyContent={"space-between"}>

              <Button
                variant="contained"
                color="primary"
                onClick={() => handleClick(item)}
              >
                Update Product
              </Button>

              <Button
                variant="contained"
                color="red"
                onClick={() => {
                  setDeleteModal(true), setDeleteId(item.product_id);
                }}
              >
                Delete Product
              </Button>
              </Box>
            </CardContent>
          </Card>
        ))
      )}
      {/* </CardContent> */}
      {/* </Card> */}
      {isOpen && (
        <ModalWrapper
          isOpen={isOpen}
          toggle={handleToggle}
          products={products}
          setProducts={setProducts}
          selectedRow={selectedRow}
          updateListingData={updateProduct}
        />
      )}

      {deleteModal && (
        <DeleteModal
          isOpen={deleteModal}
          toggle={() => setDeleteModal(false)}
          onDelete={handleDeleteProduct}
        />
      )}
    </Box>
  );
};

export default Product;
